package sopms.vo;

public class riskJochi {

	private String risk_no;
	private String id;
	private String risk_jochiCont;
	private String risk_jochiUpt;
	
	
	public riskJochi() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getRisk_no() {
		return risk_no;
	}
	public void setRisk_no(String risk_no) {
		this.risk_no = risk_no;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getRisk_jochiCont() {
		return risk_jochiCont;
	}
	public void setRisk_jochiCont(String risk_jochiCont) {
		this.risk_jochiCont = risk_jochiCont;
	}
	public String getRisk_jochiUpt() {
		return risk_jochiUpt;
	}
	public void setRisk_jochiUpt(String risk_jochiUpt) {
		this.risk_jochiUpt = risk_jochiUpt;
	}
	
	
}
